CREATE TABLE buildings (buildingid number(10) NOT NULL, addressid number(10) NOT NULL, latitude number(10), longitude number(10), PRIMARY KEY (buildingid));
CREATE TABLE rentables (rentableid number(10) NOT NULL, buildingid number(10) NOT NULL, ownerid number(10) NOT NULL, type number(1) NOT NULL, description varchar(50), area number(10) NOT NULL, window_direction varchar2(2), window_area number(10), internet number(1), cable number(1), outlet_count number(2), floor number(1), rented char(1), price float(5), PRIMARY KEY (rentableid));
CREATE TABLE persons (personid number(10) NOT NULL, addressid number(10) NOT NULL, roleid varchar2(20) NOT NULL, name varchar2(50) NOT NULL, first_name varchar2(50) NOT NULL, email varchar2(50), telephone varchar2(20) NOT NULL, cellphone varchar2(20), username varchar2(20), password varchar2(20), PRIMARY KEY (personid));
CREATE TABLE furniture (furnitureid number(10) NOT NULL, rentableid number(10) NOT NULL, name varchar2(20), price float(10) NOT NULL, damaged date, PRIMARY KEY (furnitureid));
CREATE TABLE addresses (addressid number(10) NOT NULL, street_number varchar2(5), street varchar2(50) NOT NULL, zipcode varchar2(20) NOT NULL, city varchar2(50), country varchar2(50), PRIMARY KEY (addressid));
CREATE TABLE role (type varchar2(20) NOT NULL, isuser char(1) NOT NULL, isowner char(1), isadmin char(1) NOT NULL, CONSTRAINT owner PRIMARY KEY (type));
CREATE TABLE contract (contractid number(10) NOT NULL, rentableid number(10) NOT NULL, renterid number(10), contract_start date, contract_end date, price float(5), monthly_cost float(5), guarantee float(5), PRIMARY KEY (contractid));
CREATE TABLE consumption (consumptionid number(10) NOT NULL, rentableid number(10) NOT NULL, gas number(10), water number(10), electricity number(10), date_consumption date, PRIMARY KEY (consumptionid));
CREATE TABLE messages (senderid number(10) NOT NULL, recipientid number(10) NOT NULL, subject varchar2(50), date_sent timestamp NOT NULL, message_read VARCHAR2(1) DEFAULT 0, text varchar2(255), PRIMARY KEY (date_sent));
CREATE TABLE pictures (pictureid number(10) NOT NULL, rentable_building_id number(10) NOT NULL, type_floor number(2), picture blob, PRIMARY KEY (pictureid));
CREATE TABLE constants (buildingid number(10) NOT NULL, gasprice float(5), waterprice float(5), electricityprice float(5));
CREATE TABLE Invoice (invoiceid number(10) NOT NULL, contractid number(10) NOT NULL, invoicedate date NOT NULL, paid char(1) NOT NULL, PRIMARY KEY (invoiceid));
CREATE TABLE Tasks (taskid number(10) NOT NULL, rentableid number(10) NOT NULL, description varchar2(255) NOT NULL, start_time timestamp NOT NULL, end_time timestamp NOT NULL, repeats_every number(3), PRIMARY KEY (taskid));

